import React from "react";

export default function Bodypart2() {
  return (
    <div className="body2">
      <h1>Sign Up Now</h1>
      <form>
        <input type="text" placeholder="Your Mail" />
        <input type="text" placeholder="Your Password" />
        <input type="radio" />
      </form>
    </div>
  );
}
